import React from "react";
import noResult from '../../Images/NoResult.png'

function NoResult() {

  return (
    <div className="noResult-main">
      <img src={noResult} alt={"noResult"}/>
      <h1>No Result Found !!</h1>
    </div>
  );
}

export default NoResult;
